import React from 'react';
import './App.css';
import NavBar from './NavBar';
import { Container, Box, Dialog, DialogContent, DialogTitle, IconButton } from '@material-ui/core';
import CloseIcon from '@material-ui/icons/Close';


class Page extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            isOpen: true
        }
    }

    handleClose = () => {
        this.setState({
            isOpen: false
        })
    }

    render() {
        return (
            <div>
                <NavBar/><br /><br /><br /><br />
                <Container>
                    <Brightness7Icon/>
                    <Box my={2}>
                        {[...new Array(15)]
                            .map(
                                () => `Cras mattis consectetur purus sit amet fermentum.
                                                Cras justo odio, dapibus ac facilisis in, egestas eget quam.
                                                Morbi leo risus, porta ac consectetur ac, vestibulum at eros.
                                                Praesent commodo cursus magna, vel scelerisque nisl consectetur et.`,
                            )
                            .join('\n')}
                    </Box>
                    <Dialog open={this.state.isOpen} onClose={this.handleClose}>
                        <DialogTitle>Lorem ipsum dolor sit amet.
                            <IconButton style={{float: 'right'}} onClick={this.handleClose} color="primary">
                                <CloseIcon/>
                            </IconButton>
                        </DialogTitle>
                        <DialogContent>
                            Pellentesque et augue scelerisque, sodales lacus ac, maximus ante.
                            Aliquam pellentesque massa eget varius rhoncus.
                            Phasellus pharetra est libero, non porttitor eros iaculis nec.
                            Quisque laoreet justo augue, sed pretium nibh hendrerit ut.
                            Sed in sem condimentum, sollicitudin odio eu, faucibus ante.
                            Sed ex velit, placerat ut tempor sit amet, lacinia eget leo.
                            Nullam blandit et erat non imperdiet.
                        </DialogContent>
                    </Dialog>
                </Container>
            </div>
        );
    }
}

export default Page;
